const RightDisplay = () => {
    return (
        <>
                   <>
            <Paper className="paper">
                <Scheduler data={schedulerData} height={460}>
                    <ViewState defaultCurrentDate={currentDate} />
                    <WeekView startDayHour={9} endDayHour={21} />
                    <Appointments />
                </Scheduler>
            </Paper>
        </>
        </>
    );
};

export default RightDisplay;

